import React from 'react'

export default function Pagination({ rowsPerPage, totalRow, paginate }) {
    const pageNumbers = [];
    const x = Math.ceil(totalRow / rowsPerPage)
    console.log(rowsPerPage)

    for (let i = 1; i <= x; i++) {
        pageNumbers.push(i);
    }
    console.log("total page is : ", pageNumber);

    return (
        <div className="pagination">
            <ul className='pagination'>
                {pageNumbers.map(number => (
                    <li key={number} className='page-item'>
                        <a onClick={() => paginate(number)} href='!#' className='page-link'>
                            {number}
                        </a>
                    </li>
                ))}
            </ul>

        </div>
    )
}
